import React from "react";
import {Link} from 'react-router-dom';
import './Menu.css';


const Menu = (props) => {
    let nav = props.user ?
      <div>
        <Link to='' className='Menu-link' onClick={props.handleLogout}>LOG OUT</Link>
        <span className='Menu-welcome'>WELCOME, {props.user.name}</span>
      </div>
      :
      <div>
        <Link to='/login' className='NavBar-link'>LOG IN</Link>
        <Link to='/signup' className='NavBar-link'>SIGN UP</Link>
      </div>;

    return (
      <div className='Menu'>
        {nav}
      </div>
    );
  };
export default Menu;
